import React, { Component } from 'react';
import './Home.scss';

export class Home extends Component {
  static displayName = Home.name;

  render () {
    return (
      <div>
            <img src="https://www.office2u.co.nz/images/2234/1920/banner-01.jpg" alt="doc" class="img-fluid" alt="Responsive image"></img>
      </div>
    );
  }
}
